// import logo from './logo.svg';
import './App.css';
import * as React from 'react';
import Palette from './Palette.js';
import { Button } from '@mui/material';

function App() {

  var colors = ['#D57B4F','#C1D54F','#4FD554','#4FD0D5','#4F65D5', '#D54F8C'];

  function changeColors() {
    // colors = ['#D5754F','#C1F54F','#4FD654','#4FD0D5','#4F65A5', '#D53F8C'];
  }

  return (
    <div className="App">
      <div style={{padding: 75,}}>
        <div className="App-header">
          Color Palette Generator
        </div>
        <Button className="Generate-button" variant="contained" onClick={changeColors}>
          Generate New Color Palette
        </Button>
      </div>  
      <Palette className="Palette" props={colors}/>
    </div>
  );
}

export default App;
